DROP TABLE IF EXISTS cards_categories_rates;

CREATE TABLE cards_categories_rates
(
  card_id TEXT REFERENCES cards (_id) ON DELETE CASCADE,
  earning_category_id INTEGER REFERENCES earning_categories (id) ON DELETE CASCADE,
  reward_rate_id INTEGER REFERENCES reward_rates (id) ON DELETE CASCADE,
  PRIMARY KEY(card_id, earning_category_id, reward_rate_id)

);

